INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (209,'053','때는 흉운을 만났으나 꾸준히 밝는 풍운을 만날 것입니다. 띠맵의 후회를 하여 높이 영토를 넓혀 장만하게 됩니다. 남과 다투지 않는다면 일이 해결되지 못함이 없이 순조롭게 풀릴 것입니다.','재성이 왼쪽 문을 비치니 이익을 볼 때입니다. 재물을 찾아 출동하면 길하고 예상외로 많은 이익을 보게 되겠습니다. 때가 고르고 풍운이 들었으니 태평가가 퍼질겠습니다. 이 때를 놓치지 않으면 큰 도움이 되겠습니다.','결신이 문에 비치니 이익을 볼 때입니다. 마른 용이 하늘로 높이 올라 있음과 같으니 이는 필시 큰 사람을 보는 것과 같습니다. 꼴잃이 사라지고 복이 돌아왔으며 나를 돕는 기운이 항상 곁에 있겠습니다.','이익이 어디에 있는 고 하니 필시 서쪽과 북쪽입니다. 일을 마무리 짓는데 유념하면 반드시 그 다음은 이익이 있게 됩니다. 만약 결과이 아니라면 자식을 낳거나 식구를 늘리게 되겠습니다. 예상외로 성공하게 되는데 어찌 의기가 양양하지 않겠습니까?','화기가 문에 이르러 충만할 운세입니다. 나는 용이 하늘에 높이 올라 있음과 같으니 이는 필시 큰 사람을 보는 것과 같습니다. 꼴잃이 사라지고 복이 돌아왔으며 나를 돕는 기운이 항상 곁에 있겠습니다.','이익이 이르는 곳마다 생겨나니 하루에도 천금을 얻어 흥하하겠습니다. 관인이 왼쪽 도왔주는데 어찌 그 공덕이 적겠습니까? 기가 순조롭고 바람이 고르게 부니 백가지 결실이 역매를 몰어 풍운을 기약하겠으며 하는 일은 반드시 성공하겠습니다.','재앙을 조심하십시오. 다른 사람과 다투는 것은 처음부터 낙기지 해결책이 없이 끝이게 됩니다. 그러나 재성이 목에 임했으니 재물을 얻는데는 아무런 장애가 없습니다. 다만 남과 다투는 것은 금물이니 주의하십시오.','남의 일을 받아들여 고통받기 쉽습니다. 만약 남으로 인해 꼴이 생기지 않는다면 가히 남에게 속임수를 당하게 되겠습니다. 사람을 잘못 사귀면 구설수를 면터 어려우니 사람을 조심하여 인간관계를 원만히 해야 합니다.','바라는 일은 있는 데 생각대로 떨어지지 않으니 어찌 하겠습니까. 신수가 불통하니 재물을 구하려도 띠대로 얻어지지 않습니다. 분수를 지키지 않고 탐욕을 부리면 놀한바 일을 성취하기 어려우니 분수를 지켜 자중해야 합니다.','반드시 기쁜 일이 있겠습니다. 이를 도모하면 가히 성취하게 되니 사람들이 흠모하여 추앙하게 됩니다. 양과 음이 화합하니 만물이 스스로 왕성해집니다. 기쁜 일은 도모하는 일이 성사되는 대서 비롯되니 신중하십시오.','식구가 늘어나고 녹토가 넓혀지니 복과 임이 다 풍부하여 남의 부러움을 받게 되겠습니다. 술을 가까이 하지 마십시오. 구설수가 목에 임하면 한동안 빠져나기 어렵습니다. 이익은 서쪽과 북쪽이며 마무리를 잘 지어야 합니다.','물고기와 용이 물을 얻은 것이니 드디어 활발히 삼이 전개될 운수입니다. 남방은 불리하니 실행하지 마십시오. 이미 성숙되고 있는 일을 잘 못 한다면 이루지 않습니다. 이 달의 운수는 구설수를 조심하고 하던 일을 잘 지켜야 합니다.','사람과 더불어 봄 동산에 이르니 밝은 흉하고 밝은 길합니다. 시작하는 일은 반드시 길흉이 반반입니다. 시비를 가까이 하지 마십시오. 구설수가 분분합니다. 분수를 지켜서 목력되이 거동하지 않는 것이 극심 운수를 지키는 상책입니다.','2025-03-02 11:59:29.931658+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (422,'053','当时，我们遇到了丑陋的人，但是我们将遇到明亮的风。通过遗憾的是tigade地图，我们将扩大领土的高度。如果您不与他人争论，那么它将在没有工作的情况下平稳解决。','现在是因为左门而看到利润了。如果您发现并派遣财富，您会意外地看到很多利润。选择时间，风运气将蔓延。如果您这次不错过，它将对您有所帮助。','是时候看到门上的利润了。就像一条干龙升到天空一样，就像看到一个大人物一样。损失消失了，祝福又回来了，帮助我的能力总是在我身边。','利润在哪里，必须是西方和北。如果您牢记完成工作，那么您将有利可图。如果不是结果，我们将有孩子或增加家庭。意外成功。','幸运的是充满枪支。我就像一条在天空中高高的龙，所以就像看到一个大人物一样。损失消失了，祝福又回来了，帮助我的能力总是在我身边。','无论利润到底是什么，我们每天都会赚很多钱。官员如何帮助我离开？它是光滑的大风，因此一百个水果将是风运气的泄漏和保证。','小心灾难。与他人吵架将在没有解决爆发的情况下结束。但是，由于财富在脖子周围，因此没有障碍。但是，请注意不要与他人战斗。','接受别人的工作和受苦很容易。如果由于别人而行不通，您将被别人欺骗。如果您做错了一个人，那么您应该能够与人建立良好的关系。','我想这样做，但它不会像我想的那样掉下来。新的水很不愉快，因此，即使您想节省财富，也不会作为皮带获得。如果您不保留喷泉而贪婪，那么很难完成您玩过的工作。','你一定很开心。如果这样做，您将实现它。绵羊和声音是一致的，因此所有事物变得越来越有活力。要小心，因为您会快乐的。','随着家庭的成长和生锈的扩大，祝福和林是丰富的，因此我们会羡慕别人。不要喝酒接近酒精。如果古苏尔 - 秀（Gusul -Soo）绕着脖子绕过，很难逃脱一段时间。利润在西方和北部，必须良好。','鱼和龙得到了水，因此终于很幸运地被积极发展。南方是不利的，所以不要奔跑。如果您不擅长成熟工作，那将无法实现。这个月的运气必须要小心如何小心Gusul -Soo。','这是一条与人一起春季花园的明亮道路。起始工作必须是一半。不要接近受精。古祖尔（Gusulsu）分裂了。最好保持分数并保持人群。','2025-03-02 11:59:29.931658+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (493,'053','当時、私たちは醜いと出会いましたが、明るい風に会います。 Tigadeマップを後悔することで、領土の高さを拡大します。他の人と議論しない場合、それは仕事なしでスムーズに解決されます。','左のドアのために利益を見る時が来ました。富を見つけて派遣すると、多くの利益が予想外に表示されます。時間が選ばれ、運の運が広まります。今回お見逃しなく、それはあなたを助けます。','ドアで利益を見る時が来ました。乾いたドラゴンが空に高く上昇するようなものなので、大きな人を見るようなものです。損失は消え、祝福は戻ってきて、私を助けるためのエネルギーはいつも私のそばにあります。','利益はどこですか、それは西と北でなければなりません。あなたがあなたの仕事を終えるために心に留めておくなら、あなたは利益を上げるでしょう。結果でない場合は、子供がいるか、家族を増やします。予想外に成功しています。','銃器でいっぱいになるのは幸運です。私は空が高いドラゴンのようですので、大きな人を見るようなものです。損失は消え、祝福は戻ってきて、私を助けるためのエネルギーはいつも私のそばにあります。','利益がどこにも来ても、私たちは一日にたくさんのお金を得るでしょう。役人は私を去るのをどのようにして助けてくれますか？それは滑らかで風が強いので、100の果物が漏れと運の運の誓いになります。','災害に注意してください。他の人と議論することは、最初から発生する解決策なしに終わるでしょう。しかし、富は首の周りにあるため、富を得ることに障害はありません。ただし、他の人と戦わないように注意してください。','他人の仕事を受け入れて苦しむのは簡単です。他の人のために機能しない場合、あなたは他の人にだまされます。あなたが間違った人を作るならば、あなたは人々と良い関係を作ることができるはずです。','やりたいのですが、思ったように落ちません。新しい水は不快なので、富を救いたいとしても、ベルトとしては得られません。噴水を維持せずに貪欲なら、あなたがプレイした仕事を達成することは困難です。','あなたは幸せでなければなりません。これを行うと、達成できます。羊と音が調和しているので、すべてのものが活発になります。あなたが幸せになるので注意してください。','家族が成長し、錆が拡大するにつれて、祝福とリムは金持ちになるので、私たちは他の人のvy望を受け取ります。アルコールの近くで飲まないでください。 Gusul -Sooが首の周りに来る場合、しばらく逃げることは困難です。利益は西と北にあり、うまく終了する必要があります。','魚とドラゴンは水を手に入れているので、ついに積極的に開発されたことは幸運です。南は不利なので、走らないでください。あなたが成熟した仕事が得意でない場合、それは達成されません。今月の幸運は、Gusul -Sooに注意する方法に注意しなければなりません。','春の庭のある明るく明るい道です。開始作業は半分と半分でなければなりません。受精に近づかないでください。 Gusulsuは分割されています。画分を維持し、群衆を維持するのが最善です。','2025-03-02 11:59:29.931658+00','j');
